import '../../App.css'
import './Home.scss'

const Home = () => {
    return (
        <section id='#home' className='section__home'>
            <div className='container container__home'>
            <div className='title__home'>
                <div>
                <h1>HELLO TO MY PORTFOLIO</h1>
                <p>Hi, I'm Zinchenko Vadym <br/>
                Front-end Developer.<br/>
                    from UA
                </p>
                </div>
            </div>
            </div>
        </section>
    );
};

export default Home;
